import { style } from 'd3';
import { Text, View, StyleSheet, Dimensions } from 'react-native';
import ArrowSVG from '../assets/ArrowSVG.js';

export default (props) => {
  // const makeGraph = (data) => {
  //   width = props.width;
  // }

  const vw = Dimensions.get("window").width;

  const style = StyleSheet.create({
    container: {

    },

    headingContainer: {

    },

    heading: {
      fontSize: vw * .04,
      color: "#000",
      fontFamily: "BalooTamma2-Medium"
    },

    headingData: {

    },

    subtitle: {

    },

    scaleContainer: {

    },

    arrow: {

    },

    scale: {

    },
  });

  return (
    <View style={style.container}>
      <View style={style.headingContainer}>
        <Text style={style.heading}>Jan 1</Text>
        <View style={style.headingData}>
          <Text style={style.subtitle}>Blood Pressure: </Text>
          <Text style={style.subtitle}> 110/80 mmHg</Text>
        </View>
        <View style={style.scaleContainer}>
          <ArrowSVG 
          style={{
            transform: [{rotate: ""}]
          }}
          width={vw * .04} />
          <View style={style.scale} />
        </View>
      </View>
    </View>
  );
}
